import React from "react";
import { Link, NavLink, withRouter } from "react-router-dom";

function Navbar() {
  return (
    <div className="container">
      <ul className="right">
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <NavLink to="/about">About</NavLink>
        </li>
        <li>
          <NavLink to="/contact">Contact</NavLink>
        </li>
      </ul>
    </div>
  );
}

export default withRouter(Navbar);
